import React, { Component } from 'react'
import {Router, Routes} from 'react'

export default class Content extends Component {
  render() {
    return (
      <div className='mt-20'>
        <Router>
            <Routes path="/"></Routes>
        </Router>
      </div>
    )
  }
}
